    function stripTrackingParameters(url) {
      if (!url)
        return url;
      try {
        const urlObj = new URL(url);
        const params = new URLSearchParams(urlObj.search);
        const trackingParams = [
          "utm_source",
          "utm_medium",
          "utm_campaign",
          "utm_term",
          "utm_content",
          "utm_id",
          "utm_source_platform",
          "utm_creative_format",
          "utm_marketing_tactic",
          "fbclid",
          "gclid",
          "dclid",
          "msclkid",
          "mc_cid",
          "mc_eid",
          "_ga",
          "_gid",
          "_gac",
          "ref",
          "referer",
          "referrer"
        ];
        let hasChanges = false;
        for (const param of trackingParams) {
          if (params.has(param)) {
            params.delete(param);
            hasChanges = true;
          }
        }
        if (hasChanges) {
          urlObj.search = params.toString();
          return urlObj.toString();
        }
        return url;
      } catch (error) {
        return url;
      }
    }
